function q_login(){
    
        $.ajax({
        type: 'POST',
        url: 'updateSipToken.php',
        data: {

            action: 'update_queue'

        },
        success: function (data) {
            
            
            if(data.trim() =='queue_red'){
                
               $('#make_call_number').val('*63');
            }
            else{
                $('#make_call_number').val('*62');
            }
            
            
        call('queue_call');
        $('.queue_login').attr('id',data.trim());

            

        }
    });

}
							
